input = """



"""

words = input.split('\n')
current = 5
code = []

for word in words:
    for letter in word:
        if letter == 'U' and current not in [5,2,1,4,9]:
            if current in [3, 13]:
                current -= 2
            else:
                current -= 4
        elif letter == 'D' and current not in [5,9,10,12,13]:
            if current in [1,11]:
                current += 2
            else:
                current += 4
        elif letter == 'R' and current not in [1,4,9,12,13]:
            current += 1
        elif letter == 'L' and current not in [1,2,5,10,13]:
            current -= 1
    
    code.append(current)
print(code)
